import { Button } from "govuk-react";
import { CurrentContext } from "../../Pages/Temp";
import jq from "jquery";

function MyBtn(props) {
  function getData() {
    var patientData = {
      "NHSNumber": CurrentContext.nhsNo,
    }

    jq.ajax({
      type: "POST",
      url: "http://localhost:4000/getpatientdata.php",
      mode: "no-core",
      data: patientData,
      success(data) {
        console.log("Response data:", data);

        if (data === "no patients") {
          props.callBack('');
        } else {
          var json = JSON.parse(data);
          props.callBack(json[0].Postcode);
        }
      }
    });
  }

  return (<Button  onClick={getData}> Submit </Button>);
}

export default MyBtn;
